import React from 'react'
import Guantes from './../img/guantes.jpg'
import Card from './Card'

const CategoriesList = () => {
  const CategoriesList = [
    {
      name: 'ACCESORIOS'
    },
    {
      name: 'HERRAMIENTAS'
    },
    {
      name: 'HIGIENES'
    }
  ]
  return (
    <div className='main'>
      <div className="main_header">
        <h1>CATÁLOGO</h1>
      </div>
      <div className="card-container">
        <Card img={Guantes} title={'ACCESORIOS'} goTo={''}/>
        <Card img={Guantes} title={'HERRAMIENTAS'} goTo={''}/>
        <Card img={Guantes} title={'HIGIENE'} goTo={''}/>
        
      </div>
    </div>

  )
}

export default CategoriesList
